  Component
} from 'react';
import './index.css'
import person1 from './img/person1.jpg'; //方法1引入图片前准备，后面将用src={logo}引入
import Card from './card/index.js';
class Home extends Component {
  constructor(props) {
    super(props);
  }
  componentDidMount() {
    alert('componentDidMount');
    console.log('componentDidMount');
  }
  componentDidUpdate() {
    alert('componentwillunmount');
    console.log('update');
  }
  componentWillUnmount() {
    alert('componentwillunmount');
    console.log('componentwillunmount');
  }
  render() {
    return ( 
      <>
        <Card></Card>
      </>
    )}
}

export default Home;
